Chart.defaults.global.defaultFontFamily = '-apple-system,system-ui,BlinkMacSystemFont,"Segoe UI",Roboto,"Helvetica Neue",Arial,sans-serif', Chart.defaults.global.defaultFontColor = "#292b2c";
ctx = document.getElementById("myBarChart"),

personalityData = [[0.1861912568417981, 0.7788134765228414, 0.9127321296321113,
				0.7905831146193976, 0.8789033887389277, 0.37088523386632954, 0.5982180699643708,
				0.7468044801595959, 0.17536983299287978, 0.9610865004278943, 0.5096488695583297,
				0.06998323770402848, 0.43898456488773535
			], ["Adventurousness", "Emotionality", "Liberalism",
			"Achievement striving", "Cautiousness", "Self-discipline",
			"Self-efficacy", "Assertiveness", "Excitement-seeking", "Trust", "Anxiety",
			"Immoderation", "Vulnerability"]];
personalityData = personalityData[0].map((col, j) => personalityData.map(row => row[j]));
personalityData.sort(function(a,b) {
        return -a[0]+b[0]
    });

if(document.getElementById("personality1")!=null)
	for(var i=1; i<=4; i++)
		document.getElementById("personality"+i).innerHTML=personalityData[i][1];

myLineChart = new Chart(ctx, {
	type: "bar",
	data: {
		labels: personalityData.map(function(value,index) { return value[1]; }),
		datasets: [{
			label: "Evaluation Score",
			backgroundColor: "rgba(2,117,216,1)",
			borderColor: "rgba(2,117,216,1)",
			data: personalityData.map(function(value,index) { return value[0]; })
		}]
	},
	options: { scales: { xAxes: [{ time: { unit: "type" }, gridLines: { display: !1 }, ticks: { maxTicksLimit: 13 } }], yAxes: [{ ticks: { min: 0, max: 1, maxTicksLimit: 100 }, gridLines: { display: !0 } }] }, legend: { display: !1 } }
})